import React, { lazy, Suspense } from "react";
import { 
    BrowserRouter as Router, 
    Routes,
    Route,
    Link,
} from "react-router-dom";

import * as ROUTES from "./constants/routes.js";

const Dashboard = lazy(() => import ('./pages/dashboard.js'));
const Login = lazy(() => import ('./pages/login.js'));
const Signup = lazy(() => import ('./pages/signup.js'));
const Profile = lazy(() => import ('./pages/profile.js'));
const NotFound = lazy(() => import ('./pages/not-found.js'));

export default function App(){
    return(
        <Router>
            <Suspense fallback={<p>Loading...</p>}>
                <div>
                    <ul>
                        <li><Link to={ROUTES.DASHBOARD}>Dashboard</Link></li>
                        <li><Link to={ROUTES.LOGIN}>Login</Link></li>
                        <li><Link to={ROUTES.SIGN_UP}>Signup</Link></li>
                        <li><Link to={ROUTES.PROFILE}>Profile</Link></li>
                        <li><Link to={ROUTES.NOT_FOUND}>NotFound</Link></li>
                    </ul>
                </div>
                <Routes>
                    <Route path={ROUTES.DASHBOARD} components={Dashboard}>{Dashboard}</Route>
                    <Route path={ROUTES.LOGIN} components={Login} />
                    <Route path={ROUTES.SIGN_UP} components={Signup} />
                    <Route path={ROUTES.PROFILE} components={Profile} />
                    <Route path={ROUTES.NOT_FOUND} components={NotFound} />
                </Routes>
            </Suspense>
        </Router>
    )
};
